import react from 'react';
import ReactDOM from 'react-dom';
import { Layout } from 'antd';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Auth0Provider } from '@auth0/auth0-react';
import 'antd/dist/antd.css';

const domain = process.env.REACT_APP_AUTH0_DOMAIN;
const clientId = process.env.REACT_APP_AUTH0_CLIENT_ID;
const { Header, Content, Footer, Sider } = Layout;

ReactDOM.render(
  <Auth0Provider domain={domain} clientId={clientId} redirectUri={window.location.origin}>
         <Layout>
        <Sider style={{background:'black'}} breakpoint="lg"
      collapsedWidth="0"
      onBreakpoint={broken => {
        console.log(broken);
      }}
      onCollapse={(collapsed, type) => {
        console.log(collapsed, type);
      }}>left sidebar</Sider>
         <Layout>
            <Header className="header" style={{background:'black'}}>header</Header>
            <Content >
              <App className="site-layout-background" style={{ padding: 24, minHeight: 360 }}/>
            </Content>
            <Footer>Made by MVD with <img src="http://cms.myspacecdn.com/cms/User_Home/HP_HeartIconSmall.png" alt="icon heart"></img></Footer>
          </Layout>
     </Layout>
  </Auth0Provider>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
